int check_hit(UFO *ufo, MISSILE *missile){
    int centreX = missile->x + 5;
    int centreY = missile->y + 5;

    if((centreX > ufo->x) && (centreX < ufo->x + 10) && (centreY > ufo->y) && (centreY < ufo->y + 10)){
        return 1;
    }
    else{
        return 0;
    }
}

